import './App.css';
import Main from './MainContent/Main';
import Navbar from './Navbar/Navbar';
import Skills from './Skills-Component/Skills';
import About from './About-component/About';
function App() {
  return (
    <div className="App">
      <div className='App-Header'>
        <Navbar />
        <Main />
      </div>
      <About/>
      <Skills />
    </div>
  );
}

export default App;
